import React from "react";
import { Route, Switch } from "react-router-dom"; // Importa Route y Switch de react-router-dom
import Navbar from "../src/components/navBar";
import Home from "../src/pages/home";
import Shop from "../src/pages/shop"; // Asegúrate de importar tu nueva página Shop
import "./styles/styles.css";

const App = () => {
  return (
    <div>
      <header>
        <img src="img/logo.png" alt="logo" id="logo" />
      </header>
      <Navbar />
      
      {/* Rutas para diferentes páginas */}
      <Switch> {/* Switch asegura que solo una ruta se renderice a la vez */}
        <Route exact path="/" component={Home} /> {/* Ruta principal */}
        <Route path="/shop" component={Shop} /> {/* Ruta para la página Shop */}
      </Switch>
      
      <footer>
        <p>© 2025 Electro Shop - Todos los derechos reservados</p>
      </footer>
    </div>
  );
};

export default App;
